import './Expenses.css';
import ExpenseDate from './ExpenseDate';

function Expenses(props) {
  return (
    <div className="expenses">
      <ExpenseDate date={props.date}></ExpenseDate>
      <div>
        <h2>{props.title}</h2>
        <div>${props.amount}</div>
      </div>
    </div>
  );
}

export default Expenses;
